        <li><a href="/">Home</a></li>
        <li><a href="/completedlogs">Completed logs</a></li>
        <li><a href="/team">Team</a></li>
      </ul>
    </div>

  </nav>

  <ul className="sidenav" id="mobile-demo">
  <a href="!#" data-target="mobile-demo" className="sidenav-trigger" style={{tra}} onClick={handleCloseNav}><i className="material-icons">close</i></a>
    <li><a href="/">Home</a></li>
    <li><a href="/completedlogs">Completed logs</a></li>
    <li><a href="/team">Team</a></li>
  </ul>




</div>
    )
}

export default MobileNav
